import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom';
import Header from './componentes/header';
import Footer from './componentes/footer';
import ProductGrid from './componentes/ProductGrid';

export function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <ProductGrid />

        <Footer />
      </div>
    </Router>
  );
}
